% Polynomial eigenvalue solution to the 6pt relative pose + focal length problem
%
% by M. Bujnak, Z. Kukelova (c)sep2008
%
%
% Please refer to the following paper, when using this code : 
%
%      Kukelova, Z., Bujnak, M. and Pajdla, Polynomial eigenvalue solutions 
%      to the 5-pt and 6-pt relative pose problems, BMVC 2008, Leeds, Sept. 2008
%
% [focal F] = peig6pt(Q1, Q2)
%
% input:
%
%  Q1 - 3x6 matrix with 6x2D measuremets
%  Q2 - 3x6 matrix with 6 corresponding 2D points
%
% output:
%
%  focal - vector with N focal lengths
%  F  - 3Nx3 matrix with N fundamental matrices, such that Q2(:,i)'*F*Q1(:,i) = 0

function F = est_F_from_6p(u)
    Q1 = u(1:3,:);
    Q2 = u(4:6,:);

    Q1 = Q1';
    Q2 = Q2';

    Q = [Q2(:,1).*Q1(:,1),...
        Q2(:,1).*Q1(:,2),...
        Q2(:,1).*Q1(:,3),...
        Q2(:,2).*Q1(:,1),...
        Q2(:,2).*Q1(:,2),...
        Q2(:,2).*Q1(:,3),...
        Q2(:,3).*Q1(:,1),...
        Q2(:,3).*Q1(:,2),...
        Q2(:,3).*Q1(:,3),...
        ];

    [U S V] = svd(Q);
    F1 = reshape(V(:,7), 3, 3)';
    F2 = reshape(V(:,8), 3, 3)';
    F3 = reshape(V(:,9), 3, 3)';

    % equations rewritten into coefficient matrix
    Mcoefs = zeros(10,30);
    Mcoefs(2) = 2*F1(3,1)*F1(1,3)*F1(3,3)-F1(1,1)*F1(3,3)^2;
    Mcoefs(3) = 2*F1(3,1)*F1(2,3)*F1(3,3)-F1(2,1)*F1(3,3)^2;
    Mcoefs(4) = F1(3,1)*F1(3,3)^2;
    Mcoefs(5) = -F1(1,2)*F1(3,3)^2+2*F1(3,2)*F1(1,3)*F1(3,3);
    Mcoefs(6) = -F1(2,2)*F1(3,3)^2+2*F1(3,2)*F1(2,3)*F1(3,3);
    Mcoefs(7) = F1(3,2)*F1(3,3)^2;
    Mcoefs(8) = F1(1,3)*F1(3,3)^2;
    Mcoefs(9) = F1(2,3)*F1(3,3)^2;
    Mcoefs(10) = F1(3,3)^3;
    Mcoefs(12) = -F1(3,3)^2*F2(1,1)+2*F1(1,3)*F1(3,3)*F2(3,1)+2*F1(3,1)*F1(3,3)*F2(1,3)+2*F1(3,1)*F1(1,3)*F2(3,3)-2*F1(1,1)*F1(3,3)*F2(3,3);
    Mcoefs(13) = -F1(3,3)^2*F2(2,1)+2*F1(3,1)*F1(2,3)*F2(3,3)+2*F1(3,1)*F1(3,3)*F2(2,3)+2*F1(2,3)*F1(3,3)*F2(3,1)-2*F1(2,1)*F1(3,3)*F2(3,3);
    Mcoefs(14) = 2*F1(3,1)*F1(3,3)*F2(3,3)+F1(3,3)^2*F2(3,1);
    Mcoefs(15) = -F1(3,3)^2*F2(1,2)-2*F1(1,2)*F1(3,3)*F2(3,3)+2*F1(1,3)*F1(3,3)*F2(3,2)+2*F1(3,2)*F1(1,3)*F2(3,3)+2*F1(3,2)*F1(3,3)*F2(1,3);
    Mcoefs(16) = -F1(3,3)^2*F2(2,2)+2*F1(3,2)*F1(3,3)*F2(2,3)-2*F1(2,2)*F1(3,3)*F2(3,3)+2*F1(3,2)*F1(2,3)*F2(3,3)+2*F1(2,3)*F1(3,3)*F2(3,2);
    Mcoefs(17) = F1(3,3)^2*F2(3,2)+2*F1(3,2)*F1(3,3)*F2(3,3);
    Mcoefs(18) = F1(3,3)^2*F2(1,3)+2*F1(1,3)*F1(3,3)*F2(3,3);
    Mcoefs(19) = 2*F1(2,3)*F1(3,3)*F2(3,3)+F1(3,3)^2*F2(2,3);
    Mcoefs(20) = 3*F1(3,3)^2*F2(3,3);
    Mcoefs(22) = 2*F1(3,3)*F2(3,1)*F2(1,3)+2*F1(1,3)*F2(3,1)*F2(3,3)-2*F1(3,3)*F2(1,1)*F2(3,3)-F1(1,1)*F2(3,3)^2+2*F1(3,1)*F2(1,3)*F2(3,3);
    Mcoefs(23) = 2*F1(3,1)*F2(2,3)*F2(3,3)+2*F1(3,3)*F2(3,1)*F2(2,3)-2*F1(3,3)*F2(2,1)*F2(3,3)+2*F1(2,3)*F2(3,1)*F2(3,3)-F1(2,1)*F2(3,3)^2;
    Mcoefs(24) = 2*F1(3,3)*F2(3,1)*F2(3,3)+F1(3,1)*F2(3,3)^2;
    Mcoefs(25) = -F1(1,2)*F2(3,3)^2-2*F1(3,3)*F2(1,2)*F2(3,3)+2*F1(3,2)*F2(1,3)*F2(3,3)+2*F1(1,3)*F2(3,2)*F2(3,3)+2*F1(3,3)*F2(3,2)*F2(1,3);
    Mcoefs(26) = -F1(2,2)*F2(3,3)^2+2*F1(2,3)*F2(3,2)*F2(3,3)+2*F1(3,3)*F2(3,2)*F2(2,3)+2*F1(3,2)*F2(2,3)*F2(3,3)-2*F1(3,3)*F2(2,2)*F2(3,3);
    Mcoefs(27) = F1(3,2)*F2(3,3)^2+2*F1(3,3)*F2(3,2)*F2(3,3);
    Mcoefs(28) = F1(1,3)*F2(3,3)^2+2*F1(3,3)*F2(1,3)*F2(3,3);
    Mcoefs(29) = 2*F1(3,3)*F2(2,3)*F2(3,3)+F1(2,3)*F2(3,3)^2;
    Mcoefs(30) = 3*F1(3,3)*F2(3,3)^2;
    Mcoefs(32) = -F2(1,1)*F2(3,3)^2+2*F2(3,1)*F2(1,3)*F2(3,3);
    Mcoefs(33) = -F2(2,1)*F2(3,3)^2+2*F2(3,1)*F2(2,3)*F2(3,3);
    Mcoefs(34) = F2(3,1)*F2(3,3)^2;
    Mcoefs(35) = 2*F2(3,2)*F2(1,3)*F2(3,3)-F2(1,2)*F2(3,3)^2;
    Mcoefs(36) = -F2(2,2)*F2(3,3)^2+2*F2(3,2)*F2(2,3)*F2(3,3);
    Mcoefs(37) = F2(3,2)*F2(3,3)^2;
    Mcoefs(38) = F2(1,3)*F2(3,3)^2;
    Mcoefs(39) = F2(2,3)*F2(3,3)^2;
    Mcoefs(40) = F2(3,3)^3;
    Mcoefs(42) = F1(1,1)*F1(1,3)^2+F1(1,1)*F1(3,1)^2-F1(1,1)*F1(2,3)^2-F1(1,1)*F1(3,2)^2+2*F1(3,1)*F1(1,2)*F1(3,2)+2*F1(2,1)*F1(1,3)*F1(2,3);
    Mcoefs(43) = 2*F1(3,1)*F1(3,2)*F1(2,2)+F1(2,1)*F1(3,1)^2+F1(2,1)*F1(2,3)^2-F1(2,1)*F1(3,2)^2-F1(2,1)*F1(1,3)^2+2*F1(1,1)*F1(1,3)*F1(2,3);
    Mcoefs(44) = F1(3,1)*F1(3,2)^2-F1(3,1)*F1(1,3)^2-F1(3,1)*F1(2,3)^2+2*F1(2,1)*F1(2,3)*F1(3,3)+F1(3,1)^3+2*F1(1,1)*F1(1,3)*F1(3,3);
    Mcoefs(45) = F1(1,2)*F1(1,3)^2-F1(1,2)*F1(2,3)^2-F1(3,1)^2*F1(1,2)+2*F1(2,2)*F1(1,3)*F1(2,3)+F1(1,2)*F1(3,2)^2+2*F1(1,1)*F1(3,1)*F1(3,2);
    Mcoefs(46) = -F1(2,2)*F1(1,3)^2-F1(3,1)^2*F1(2,2)+F1(3,2)^2*F1(2,2)+F1(2,2)*F1(2,3)^2+2*F1(2,1)*F1(3,1)*F1(3,2)+2*F1(1,2)*F1(1,3)*F1(2,3);
    Mcoefs(47) = 2*F1(2,2)*F1(2,3)*F1(3,3)+2*F1(1,2)*F1(1,3)*F1(3,3)+F1(3,2)^3+F1(3,1)^2*F1(3,2)-F1(3,2)*F1(1,3)^2-F1(3,2)*F1(2,3)^2;
    Mcoefs(48) = -F1(3,2)^2*F1(1,3)-F1(3,1)^2*F1(1,3)+F1(1,3)*F1(2,3)^2+2*F1(1,2)*F1(3,2)*F1(3,3)+2*F1(1,1)*F1(3,1)*F1(3,3)+F1(1,3)^3;
    Mcoefs(49) = F1(1,3)^2*F1(2,3)-F1(3,1)^2*F1(2,3)+2*F1(3,2)*F1(2,2)*F1(3,3)+F1(2,3)^3-F1(3,2)^2*F1(2,3)+2*F1(2,1)*F1(3,1)*F1(3,3);
    Mcoefs(50) = F1(3,1)^2*F1(3,3)+F1(1,3)^2*F1(3,3)+F1(3,2)^2*F1(3,3)+F1(2,3)^2*F1(3,3);
    Mcoefs(52) = F1(1,3)^2*F2(1,1)-F1(2,3)^2*F2(1,1)-F1(3,2)^2*F2(1,1)+F1(3,1)^2*F2(1,1)+2*F1(1,1)*F1(1,3)*F2(1,3)-2*F1(1,1)*F1(3,2)*F2(3,2)-2*F1(1,1)*F1(2,3)*F2(2,3)+2*F1(1,2)*F1(3,2)*F2(3,1)+2*F1(3,1)*F1(1,2)*F2(3,2)+2*F1(3,1)*F1(3,2)*F2(1,2)+2*F1(1,1)*F1(3,1)*F2(3,1)+2*F1(2,1)*F1(1,3)*F2(2,3)+2*F1(1,3)*F1(2,3)*F2(2,1)+2*F1(2,1)*F1(2,3)*F2(1,3);
    Mcoefs(53) = -2*F1(2,1)*F1(3,2)*F2(3,2)+2*F1(1,1)*F1(2,3)*F2(1,3)+2*F1(1,3)*F1(2,3)*F2(1,1)+2*F1(1,1)*F1(1,3)*F2(2,3)+2*F1(2,1)*F1(2,3)*F2(2,3)+2*F1(3,2)*F1(2,2)*F2(3,1)+2*F1(2,1)*F1(3,1)*F2(3,1)+2*F1(3,1)*F1(2,2)*F2(3,2)+2*F1(3,1)*F1(3,2)*F2(2,2)-2*F1(2,1)*F1(1,3)*F2(1,3)+F1(2,3)^2*F2(2,1)-F1(1,3)^2*F2(2,1)-F1(3,2)^2*F2(2,1)+F1(3,1)^2*F2(2,1);
    Mcoefs(54) = -2*F1(3,1)*F1(1,3)*F2(1,3)-2*F1(3,1)*F1(2,3)*F2(2,3)+2*F1(1,3)*F1(3,3)*F2(1,1)+F1(3,2)^2*F2(3,1)+3*F1(3,1)^2*F2(3,1)+2*F1(2,1)*F1(2,3)*F2(3,3)+2*F1(2,1)*F1(3,3)*F2(2,3)+2*F1(1,1)*F1(1,3)*F2(3,3)+2*F1(1,1)*F1(3,3)*F2(1,3)+2*F1(2,3)*F1(3,3)*F2(2,1)+2*F1(3,1)*F1(3,2)*F2(3,2)-F1(1,3)^2*F2(3,1)-F1(2,3)^2*F2(3,1);
    Mcoefs(55) = 2*F1(1,2)*F1(1,3)*F2(1,3)+F1(1,3)^2*F2(1,2)-F1(3,1)^2*F2(1,2)-F1(2,3)^2*F2(1,2)+F1(3,2)^2*F2(1,2)+2*F1(2,2)*F1(2,3)*F2(1,3)-2*F1(1,2)*F1(2,3)*F2(2,3)+2*F1(2,2)*F1(1,3)*F2(2,3)+2*F1(1,1)*F1(3,1)*F2(3,2)+2*F1(1,1)*F1(3,2)*F2(3,1)+2*F1(3,1)*F1(3,2)*F2(1,1)+2*F1(1,2)*F1(3,2)*F2(3,2)-2*F1(3,1)*F1(1,2)*F2(3,1)+2*F1(1,3)*F1(2,3)*F2(2,2);
    Mcoefs(56) = 2*F1(1,2)*F1(2,3)*F2(1,3)+2*F1(1,2)*F1(1,3)*F2(2,3)+2*F1(3,1)*F1(3,2)*F2(2,1)+2*F1(2,1)*F1(3,1)*F2(3,2)+2*F1(1,3)*F1(2,3)*F2(1,2)+2*F1(3,2)*F1(2,2)*F2(3,2)+2*F1(2,2)*F1(2,3)*F2(2,3)-2*F1(2,2)*F1(1,3)*F2(1,3)+2*F1(2,1)*F1(3,2)*F2(3,1)-2*F1(3,1)*F1(2,2)*F2(3,1)-F1(1,3)^2*F2(2,2)+F1(3,2)^2*F2(2,2)+F1(2,3)^2*F2(2,2)-F1(3,1)^2*F2(2,2);
    Mcoefs(57) = F1(3,1)^2*F2(3,2)-F1(1,3)^2*F2(3,2)+3*F1(3,2)^2*F2(3,2)-F1(2,3)^2*F2(3,2)+2*F1(1,2)*F1(3,3)*F2(1,3)+2*F1(1,3)*F1(3,3)*F2(1,2)+2*F1(2,2)*F1(2,3)*F2(3,3)+2*F1(2,3)*F1(3,3)*F2(2,2)+2*F1(3,1)*F1(3,2)*F2(3,1)+2*F1(2,2)*F1(3,3)*F2(2,3)+2*F1(1,2)*F1(1,3)*F2(3,3)-2*F1(3,2)*F1(2,3)*F2(2,3)-2*F1(3,2)*F1(1,3)*F2(1,3);
    Mcoefs(58) = 2*F1(1,1)*F1(3,3)*F2(3,1)+2*F1(3,1)*F1(3,3)*F2(1,1)+2*F1(1,2)*F1(3,3)*F2(3,2)+2*F1(1,3)*F1(2,3)*F2(2,3)-2*F1(3,1)*F1(1,3)*F2(3,1)-2*F1(3,2)*F1(1,3)*F2(3,2)+2*F1(3,2)*F1(3,3)*F2(1,2)+2*F1(1,2)*F1(3,2)*F2(3,3)-F1(3,2)^2*F2(1,3)-F1(3,1)^2*F2(1,3)+F1(2,3)^2*F2(1,3)+3*F1(1,3)^2*F2(1,3)+2*F1(1,1)*F1(3,1)*F2(3,3);
    Mcoefs(59) = 2*F1(2,2)*F1(3,3)*F2(3,2)+2*F1(3,2)*F1(3,3)*F2(2,2)+2*F1(1,3)*F1(2,3)*F2(1,3)-F1(3,1)^2*F2(2,3)-F1(3,2)^2*F2(2,3)+F1(1,3)^2*F2(2,3)+3*F1(2,3)^2*F2(2,3)-2*F1(3,2)*F1(2,3)*F2(3,2)+2*F1(3,2)*F1(2,2)*F2(3,3)+2*F1(2,1)*F1(3,1)*F2(3,3)+2*F1(2,1)*F1(3,3)*F2(3,1)-2*F1(3,1)*F1(2,3)*F2(3,1)+2*F1(3,1)*F1(3,3)*F2(2,1);
    Mcoefs(60) = 2*F1(2,3)*F1(3,3)*F2(2,3)+2*F1(3,1)*F1(3,3)*F2(3,1)+2*F1(3,2)*F1(3,3)*F2(3,2)+2*F1(1,3)*F1(3,3)*F2(1,3)+F1(3,1)^2*F2(3,3)+F1(1,3)^2*F2(3,3)+F1(3,2)^2*F2(3,3)+F1(2,3)^2*F2(3,3);
    Mcoefs(62) = F1(1,1)*F2(1,3)^2+F1(1,1)*F2(3,1)^2+2*F1(1,3)*F2(2,1)*F2(2,3)-F1(1,1)*F2(2,3)^2-F1(1,1)*F2(3,2)^2+2*F1(3,1)*F2(1,2)*F2(3,2)+2*F1(3,1)*F2(1,1)*F2(3,1)+2*F1(1,2)*F2(3,1)*F2(3,2)+2*F1(3,2)*F2(3,1)*F2(1,2)-2*F1(3,2)*F2(1,1)*F2(3,2)-2*F1(2,3)*F2(1,1)*F2(2,3)+2*F1(1,3)*F2(1,1)*F2(1,3)+2*F1(2,3)*F2(2,1)*F2(1,3)+2*F1(2,1)*F2(1,3)*F2(2,3);
    Mcoefs(63) = 2*F1(2,3)*F2(1,1)*F2(1,3)+2*F1(1,3)*F2(1,1)*F2(2,3)+2*F1(3,1)*F2(2,1)*F2(3,1)+2*F1(3,1)*F2(3,2)*F2(2,2)+F1(2,1)*F2(3,1)^2-F1(2,1)*F2(3,2)^2-F1(2,1)*F2(1,3)^2+F1(2,1)*F2(2,3)^2+2*F1(2,3)*F2(2,1)*F2(2,3)+2*F1(1,1)*F2(1,3)*F2(2,3)+2*F1(3,2)*F2(3,1)*F2(2,2)+2*F1(2,2)*F2(3,1)*F2(3,2)-2*F1(3,2)*F2(2,1)*F2(3,2)-2*F1(1,3)*F2(2,1)*F2(1,3);
    Mcoefs(64) = 2*F1(1,3)*F2(1,1)*F2(3,3)+2*F1(3,3)*F2(1,1)*F2(1,3)+2*F1(2,1)*F2(2,3)*F2(3,3)+2*F1(3,2)*F2(3,1)*F2(3,2)-2*F1(1,3)*F2(3,1)*F2(1,3)-2*F1(2,3)*F2(3,1)*F2(2,3)+2*F1(1,1)*F2(1,3)*F2(3,3)+2*F1(2,3)*F2(2,1)*F2(3,3)+2*F1(3,3)*F2(2,1)*F2(2,3)+3*F1(3,1)*F2(3,1)^2+F1(3,1)*F2(3,2)^2-F1(3,1)*F2(1,3)^2-F1(3,1)*F2(2,3)^2;
    Mcoefs(65) = -F1(1,2)*F2(3,1)^2+2*F1(1,1)*F2(3,1)*F2(3,2)+2*F1(3,1)*F2(1,1)*F2(3,2)+2*F1(3,2)*F2(1,1)*F2(3,1)+2*F1(3,2)*F2(1,2)*F2(3,2)+F1(1,2)*F2(1,3)^2+F1(1,2)*F2(3,2)^2-2*F1(3,1)*F2(3,1)*F2(1,2)-2*F1(2,3)*F2(1,2)*F2(2,3)-F1(1,2)*F2(2,3)^2+2*F1(2,3)*F2(2,2)*F2(1,3)+2*F1(2,2)*F2(1,3)*F2(2,3)+2*F1(1,3)*F2(2,2)*F2(2,3)+2*F1(1,3)*F2(1,2)*F2(1,3);
